import React, { useState } from 'react';
import {
  Container,
  Grid,
  Card,
  CardMedia,
  CardContent,
  CardActions,
  Typography,
  Button,
  TextField,
  Box,
  Chip,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
} from '@mui/material';

const defaultImage = 'https://images.unsplash.com/photo-1451187580459-43490279c0fa?auto=format&fit=crop&w=800&q=80';

const products = [
  {
    id: 1,
    name: 'Professional Telescope',
    category: 'Equipment',
    description: 'High-powered telescope for deep space observation',
    image: defaultImage,
    price: 599.99,
  },
  {
    id: 2,
    name: 'Solar System Model',
    category: 'Educational',
    description: 'Interactive 3D model of our solar system',
    image: defaultImage,
    price: 89.99,
  },
  {
    id: 3,
    name: 'Space Explorer Kit',
    category: 'Educational',
    description: 'Educational kit for young astronomers',
    image: defaultImage,
    price: 49.99,
  },
  {
    id: 4,
    name: 'Constellation Map',
    category: 'Accessories',
    description: 'Detailed map of the night sky',
    image: defaultImage,
    price: 29.99,
  },
  {
    id: 5,
    name: 'Mars Globe',
    category: 'Collectibles',
    description: 'Detailed topographical globe of Mars',
    image: defaultImage,
    price: 79.99,
  },
  {
    id: 6,
    name: 'Astronomy Binoculars',
    category: 'Equipment',
    description: 'Professional-grade astronomical binoculars',
    image: defaultImage,
    price: 199.99,
  },
];

const categories = ['All', 'Equipment', 'Educational', 'Accessories', 'Collectibles'];

const Products = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState('All');
  const [sortBy, setSortBy] = useState('name');

  const filteredProducts = products
    .filter(product => 
      (selectedCategory === 'All' || product.category === selectedCategory) &&
      product.name.toLowerCase().includes(searchTerm.toLowerCase())
    )
    .sort((a, b) => {
      if (sortBy === 'price-low') return a.price - b.price;
      if (sortBy === 'price-high') return b.price - a.price;
      return a.name.localeCompare(b.name);
    });

  return (
    <Container sx={{ py: 8 }}>
      <Box sx={{ mb: 4 }}>
        <Typography variant="h2" sx={{ mb: 4, textAlign: 'center' }}>
          Explore Our Products
        </Typography>

        <Grid container spacing={2} sx={{ mb: 4 }}>
          <Grid item xs={12} sm={6} md={4}>
            <TextField
              fullWidth
              label="Search Products"
              variant="outlined"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              sx={{ 
                '& .MuiOutlinedInput-root': {
                  '& fieldset': { borderColor: 'rgba(255,255,255,0.23)' },
                  '&:hover fieldset': { borderColor: 'rgba(255,255,255,0.4)' },
                },
                '& .MuiInputLabel-root': { color: 'rgba(255,255,255,0.7)' },
                '& .MuiInputBase-input': { color: 'white' },
                background: 'rgba(255,255,255,0.05)',
                borderRadius: 1,
              }}
            />
          </Grid>
          <Grid item xs={12} sm={6} md={4}>
            <FormControl fullWidth>
              <InputLabel sx={{ color: 'rgba(255,255,255,0.7)' }}>Category</InputLabel>
              <Select
                value={selectedCategory}
                onChange={(e) => setSelectedCategory(e.target.value)}
                sx={{ 
                  '& .MuiOutlinedInput-notchedOutline': {
                    borderColor: 'rgba(255,255,255,0.23)',
                  },
                  '&:hover .MuiOutlinedInput-notchedOutline': {
                    borderColor: 'rgba(255,255,255,0.4)',
                  },
                  color: 'white',
                  background: 'rgba(255,255,255,0.05)',
                }}
              >
                {categories.map(category => (
                  <MenuItem key={category} value={category}>
                    {category}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
          </Grid>
          <Grid item xs={12} sm={6} md={4}>
            <FormControl fullWidth>
              <InputLabel sx={{ color: 'rgba(255,255,255,0.7)' }}>Sort By</InputLabel>
              <Select
                value={sortBy}
                onChange={(e) => setSortBy(e.target.value)}
                sx={{ 
                  '& .MuiOutlinedInput-notchedOutline': {
                    borderColor: 'rgba(255,255,255,0.23)',
                  },
                  '&:hover .MuiOutlinedInput-notchedOutline': {
                    borderColor: 'rgba(255,255,255,0.4)',
                  },
                  color: 'white',
                  background: 'rgba(255,255,255,0.05)',
                }}
              >
                <MenuItem value="name">Name</MenuItem>
                <MenuItem value="price-low">Price: Low to High</MenuItem>
                <MenuItem value="price-high">Price: High to Low</MenuItem>
              </Select>
            </FormControl>
          </Grid>
        </Grid>
      </Box>

      <Grid container spacing={4}>
        {filteredProducts.map((product) => (
          <Grid item key={product.id} xs={12} sm={6} md={4}>
            <Card
              sx={{
                height: '100%',
                display: 'flex',
                flexDirection: 'column',
                background: 'rgba(255,255,255,0.05)',
                backdropFilter: 'blur(10px)',
                border: '1px solid rgba(255,255,255,0.1)',
                transition: 'transform 0.3s ease-in-out, box-shadow 0.3s ease-in-out',
                '&:hover': {
                  transform: 'translateY(-8px)',
                  boxShadow: '0 12px 20px rgba(0,0,0,0.2)',
                },
              }}
            >
              <CardMedia
                component="img"
                height="200"
                image={product.image}
                alt={product.name}
                sx={{ 
                  objectFit: 'cover',
                  borderBottom: '1px solid rgba(255,255,255,0.1)',
                }}
              />
              <CardContent sx={{ flexGrow: 1 }}>
                <Typography gutterBottom variant="h5" component="h2">
                  {product.name}
                </Typography>
                <Chip
                  label={product.category}
                  size="small"
                  sx={{ 
                    mb: 2,
                    background: 'rgba(124, 77, 255, 0.2)',
                    color: 'white',
                  }}
                />
                <Typography>{product.description}</Typography>
                <Typography variant="h6" sx={{ mt: 2, color: 'secondary.main' }}>
                  ${product.price.toFixed(2)}
                </Typography>
              </CardContent>
              <CardActions>
                <Button 
                  size="small" 
                  color="secondary"
                  sx={{
                    '&:hover': {
                      background: 'rgba(124, 77, 255, 0.2)',
                    },
                  }}
                >
                  Add to Cart
                </Button>
                <Button 
                  size="small" 
                  color="secondary"
                  sx={{
                    '&:hover': {
                      background: 'rgba(124, 77, 255, 0.2)',
                    },
                  }}
                >
                  View Details
                </Button>
              </CardActions>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Products;
